import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
width: 100%;
height: 80vh;
background-color: whitesmoke;
margin-top: 50px;
`;

const StyleWrapper=styled.div`
width: 50%;
height: 100%;
background-color: yellow;
margin-left: auto;
`;


const TextingDeals = () => {
    return (
       <Container>
           <div class="container">
  <div class="row">
    <div class="col">
      Column
    </div>
    <div class="col">
      Column
    </div>
    <div class="col">
      Column
    </div>
  </div>
</div>
<h1>I am Visible</h1>
           <StyleWrapper>
<h1>I am also Visible</h1>
           </StyleWrapper>
       </Container>
    )
}

export default TextingDeals
